import './App.css';
import Home from './components/Home'
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';

const App = () => {
  return (
    <div className="App">
      <BrowserRouter>
        <Link to='/'>Home</Link>

        <Routes>
          <Route path = '/' elements = {<Home/>} />
        </Routes>
      </BrowserRouter>
      <h1>Hello, world</h1>
    </div>
  );
}

export default App;
